def get_module_ns(self, ns):
    """ID: dc1a7557-d329-4c4c-962f-1064a526e539"""
    defi: Definition = self.def_manager.get(ns)
    while not defi or defi.get_type() != utils.constants.MOD_DEF:
        ns = ns[: ns.rfind(".")]
        if not ns:
            break
        defi = self.def_manager.get(ns)
    return ns
